import React from 'react';
import "./App.css";


//Navbar
import Navbar from './navbar'

// Banner
import Banner from "./navbar_banner"

// Main
import Featured from "./featured"

//Footer
import Footer from './footer';

//Video
import Vid from "./Images/cosmetics.mp4"

function Video(){
   return(
    <div>
        <video
        style={{width: "97%", margin: "0 auto" }}
        autoPlay
        loop
        muted
        alt="All the devices"
        src={Vid} />
  </div>
    )

}


export default function App(){
  return(
    <div>
      <div id="App">
      <Navbar />
      <Video />
      <Banner />
      <Featured />
      <Footer />
   </div>
   </div>

  )
}
